package icons

import (
	"github.com/gogf/gf/v2/net/ghttp"
	"github.com/yimuysl001/gtoolboxs/utility/swagger/constant"
	"github.com/yimuysl001/gtoolboxs/utility/swagger/utils"
)

const (
	APPLE_TOUCH_ICON_60X60_PNG_RELATIVE_PATH = constant.ROOT_PATH + "/img/icons/apple-touch-icon-60x60.png"
	// 文件内容的16进制表示
	APPLE_TOUCH_ICON_60X60_PNG_HEX_CONTENT = ``
)

func AddRouterOfAppleTouchIcon60x60Png(router *ghttp.RouterGroup) {

	utils.GetOther(router, APPLE_TOUCH_ICON_60X60_PNG_RELATIVE_PATH, APPLE_TOUCH_ICON_60X60_PNG_HEX_CONTENT)

}
